import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';

const RegisterScreen = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    name: '',
    birthdate: '',
    password: '',
    confirmPassword: '',
    dni: null,
  });
  const [error, setError] = useState('');

  const handleChange = e => {
    const { name, value, files } = e.target;
    if (name === 'dni') {
      setFormData(prev => ({ ...prev, dni: files[0] }));
    } else {
      setFormData(prev => ({ ...prev, [name]: value }));
    }
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setError('');

    if (!formData.name || !formData.birthdate || !formData.password || !formData.confirmPassword || !formData.dni) {
      setError('Por favor completá todos los campos.');
      return;
    }

    if (formData.password !== formData.confirmPassword) {
      setError('Las contraseñas no coinciden.');
      return;
    }

    try {
      const formPayload = new FormData();
      formPayload.append('name', formData.name);
      formPayload.append('birthdate', formData.birthdate);
      formPayload.append('password', formData.password);
      formPayload.append('dni', formData.dni);

      const res = await fetch('http://localhost:5001/api/auth/register', {
        method: 'POST',
        body: formPayload,
      });

      const data = await res.json();

      if (!res.ok) {
        setError(data.message || 'Error al registrar usuario.');
        return;
      }

      navigate('/login');
    } catch (err) {
      console.error(err);
      setError('Error de conexión con el servidor.');
    }
  };

  return (
    <div style={styles.container}>
      <form onSubmit={handleSubmit} style={styles.form} encType="multipart/form-data">
        <h2 style={styles.title}>Registrarse</h2>

        {error && <div style={styles.error}>{error}</div>}

        <label style={styles.label}>Nombre Completo</label>
        <input
          type="text"
          name="name"
          placeholder="Tu nombre completo"
          value={formData.name}
          onChange={handleChange}
          style={styles.input}
          autoComplete="off"
        />

        <label style={styles.label}>Fecha de Nacimiento</label>
        <input
          type="date"
          name="birthdate"
          value={formData.birthdate}
          onChange={handleChange}
          style={styles.input}
        />

        <label style={styles.label}>Contraseña</label>
        <input
          type="password"
          name="password"
          placeholder="Tu contraseña"
          value={formData.password}
          onChange={handleChange}
          style={styles.input}
          autoComplete="off"
        />

        <label style={styles.label}>Confirmar Contraseña</label>
        <input
          type="password"
          name="confirmPassword"
          placeholder="Confirmá tu contraseña"
          value={formData.confirmPassword}
          onChange={handleChange}
          style={styles.input}
          autoComplete="off"
        />

        <label style={styles.label}>Subí tu DNI (imagen)</label>
        <input
          type="file"
          name="dni"
          accept="image/*"
          onChange={handleChange}
          style={{ marginTop: 5 }}
        />

        <button type="submit" style={styles.button}>
          Registrarse
        </button>

        <p style={styles.text}>
          ¿Ya tenés cuenta?{' '}
          <Link to="/login" style={styles.link}>
            Iniciá sesión acá
          </Link>
        </p>
      </form>
    </div>
  );
};

const styles = {
  container: {
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #4B0082 0%, #120136 100%)',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  form: {
    backgroundColor: '#fff',
    borderRadius: 15,
    padding: '40px 30px',
    width: '100%',
    maxWidth: 450,
    boxShadow: '0 8px 24px rgba(0,0,0,0.2)',
    color: '#4B0082',
    fontFamily: 'Segoe UI, Tahoma, Geneva, Verdana, sans-serif',
  },
  title: {
    textAlign: 'center',
    color: '#DAA520',
    marginBottom: 25,
    fontWeight: 'bold',
    fontSize: 28,
  },
  label: {
    display: 'block',
    marginBottom: 6,
    marginTop: 18,
    fontWeight: '600',
    fontSize: 14,
  },
  input: {
    width: '100%',
    padding: '10px 12px',
    borderRadius: 8,
    border: '2px solid #4B0082',
    fontSize: 16,
    outline: 'none',
    transition: 'border-color 0.3s ease',
  },
  button: {
    width: '100%',
    marginTop: 30,
    padding: '12px',
    borderRadius: 8,
    backgroundColor: '#DAA520',
    color: '#4B0082',
    fontWeight: 'bold',
    fontSize: 18,
    cursor: 'pointer',
    border: 'none',
    boxShadow: '0 4px 8px rgba(218, 165, 32, 0.6)',
    transition: 'background-color 0.3s ease',
  },
  text: {
    marginTop: 20,
    textAlign: 'center',
    fontSize: 14,
    color: '#555',
  },
  link: {
    color: '#DAA520',
    fontWeight: 'bold',
    textDecoration: 'none',
  },
  error: {
    backgroundColor: '#f44336',
    color: 'white',
    padding: '10px 15px',
    borderRadius: 8,
    textAlign: 'center',
    marginBottom: 15,
  },
};

export default RegisterScreen;
